import useQuotes from "../UseQuotes";

function Counter() {
  const { totalQamount, totalFamount } = useQuotes();
  return (
    <div className="flex">
      <h3 style={{ justifyContent: "flex-start" }}>
        Total quote count: {totalQamount}
      </h3>
      <h3 style={{ justifyContent: "flex-start" }}>
        Quotes in view: {totalFamount}
      </h3>
    </div>
  );
}

export default Counter;
